import React, { Component } from 'react';
import { Card } from 'react-bootstrap';
import { useBarcode } from '@createnextapp/react-barcode';
class ExitCode extends Component {

    render() { 
        const { inputRef } = useBarcode({
            value: 'createnextapp',
            options: {
              background: '#ccffff',
            }
          });
        return ( <div>
            <Card>
                <Card.Header>
                    Thank You!
                </Card.Header>
                <Card.Body>
                <svg ref={inputRef} />
                </Card.Body>
            </Card>
        </div> );
    }
}
 
export default ExitCode;
